import React, { Component } from 'react';

class DataLister extends Component {

    constructor(props) {
        super(props);
        this.state = {
            dataReady: false,
            data: []
        };
    }

    fetchData = () => {
        let path = require('http://localhost:8080/getData');

        fetch(path)
            .then((res) => console.log(res));
    };

    componentDidMount() {
        this.fetchData();
    }

    render() {

        if (!this.state.dataReady)
        {
            return <div />
        }

        return (
            <h1>Hi!</h1>
        );
    }

}
